import React from 'react';
import Table from 'react-bootstrap/Table';
import CommunityTab from './CommunityTab';

function Market() {
    return (
        <>
        <CommunityTab />

        <Table striped bordered hover>
            <tr>
                <th>Row</th>
                <th>제목</th>
                <th>등록일</th>
                <th>등록자</th>
            </tr>
        </Table>

        <Table striped bordered hover>
            <tr className='hidden_type'>
                <td>1</td>
                <td>선인장 분양합니다.</td>
                <td>2022. 05. 22.</td>
                <td>참새</td>
            </tr>
            <tr className='hidden_type'>
                <td>2</td>
                <td>장미허브 분양합니다.</td>
                <td>2022. 05. 30.</td>
                <td>오리</td>
            </tr>
        </Table>

        </>
    )
}

export default Market;

